import React from "react";
import heroBg from "../assets/images/hero-bg.jpg";
import "./Home.css";

const Home = () => {
  return (
    <section
      id="home"
      className="home"
      style={{ backgroundImage: `url(${heroBg})` }}
    >
      <div className="hero">
        <h1>
          Welcome to <span>WR </span>Resto
        </h1>
        <p>Delicious meals, made fresh for you!</p>
        <a href="#menu" className="btn">
          View Menu
        </a>
      </div>
    </section>
  );
};

export default Home;
